import React from 'react';
import '../App.css';
import {socialLinks} from "./constants";
import styles, {layout} from "../style";

const Socials = () => {
  const socialItems = socialLinks.map( social=>
    <SocialsDisplay social={social} />
  )

  return (
    <section id="socials" className={layout.section}>
      <h2 className={`${styles.heading2} flex flex-1`}>Socials</h2>
      {socialItems}
    </section>
  )
}

const SocialsDisplay = (social) => {
  return(
    <div className={layout.section}>
      <img className={`w-[200px]`} src={social.src} alt={social.name} />
    </div>
  )
}


export default Socials
